}, "lang": "de"}, {"created_at": "2022-01-28T14:50:58.000Z", "source": "Twitter for iPhone", "possibly_sensitive": false, "author_id": "159217491", "reply_settings": "everyone", "conversation_id": "1487075736691175424", "id": "1487075736691175424", "entities": {"hashtags": [{"start": 13, "end": 28, "tag": "Zeugnisausgabe"}]}, "text": "Zur heutigen #Zeugnisausgabe begl\u00fcckw\u00fcnsche ich alle, die mit einem L\u00e4cheln nach Hause kommen und f\u00fchle mit denen, denen der Weg nach Hause schwerf\u00e4llt. Zahlen auf einem Blatt Papier sagen nur sehr wenig \u00fcber einen Menschen aus! Genie\u00dft das lange Ferienwochenende!", "public_metrics": {"retweet_count": 2, "reply_count": 1, "like_count": 5, "quote_count": 0}, "lang": "de"}, {"created_at": "2022-01-27T17:26:35.000Z", "source": "Twitter for iPhone", "possibly_sensitive": true, "author_id": "159217491", "reply_settings": "everyone", "conversation_id": "1486752510362726407", "id": "1486752510362726407", "entities": {"hashtags": [{"start": 218, "end": 229, "tag": "WeRemember"}], "urls": [{"start": 230, "end": 253, "url": "https://t.co/04I2z2AArd", "expanded_url": "https://twitter.com/Johann_Saathoff/status/1486752510362726407/photo/1", "display_url": "pic.twitter.com/04I2z2AArd"}]}, "attachments": {"media_keys": ["3_1486752504142569476"]}, "text": "Die Erinnerung wachzuhalten liegt in unserer Verantwortung, ist unsere Pflicht. In diesen Zeiten mehr denn je. Wir d\u00fcrfen niemals vergessen. Wir m\u00fcssen Antisemitismus, Hass &amp; Rassismus unerbittlich entgegentreten. #WeRemember https://t.co/04I2z2AArd", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 16, "quote_count": 0}, "lang": "de"}, {"referenced_tweets": [{"type": "retweeted", "id": "1484579178183802881"}], "created_at": "2022-01-21T18:35:19.000Z", "source": "Twitter for iPhone", "possibly_sensitive": false, "author_id": "159217491", "reply_settings": "everyone", "conversation_id": "1484595481787441152", "id": "1484595481787