: "Twitter for iPhone", "id": "1398348684010700811", "text": "@elozwerg Ja, das ist schon 118 mal bewiesen. Bei Plattdeutsch fremdelt der Bundestagspr\u00e4sident noch ein wenig...", "created_at": "2021-05-28T18:41:20.000Z", "possibly_sensitive": false, "referenced_tweets": [{"type": "replied_to", "id": "1398347510817738753"}], "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 1, "quote_count": 0}, "lang": "de", "reply_settings": "everyone", "author_id": "159217491", "in_reply_to_user_id": "345761915", "entities": {"mentions": [{"start": 0, "end": 9, "username": "elozwerg", "id": "345761915"}]}, "conversation_id": "1398346750058958848"}, {"source": "Twitter for iPhone", "id": "1398346750058958848", "text": "Bester Pr\u00e4sident! \nIch bin f\u00fcr eine zweite Amtszeit! https://t.co/dgPvC1LE24", "created_at": "2021-05-28T18:33:39.000Z", "possibly_sensitive": true, "public_metrics": {"retweet_count": 1, "reply_count": 3, "like_count": 18, "quote_count": 0}, "lang": "de", "entities": {"urls": [{"start": 53, "end": 76, "url": "https://t.co/dgPvC1LE24", "expanded_url": "https://twitter.com/Johann_Saathoff/status/1398346750058958848/photo/1", "display_url": "pic.twitter.com/dgPvC1LE24"}]}, "reply_settings": "everyone", "author_id": "159217491", "attachments": {"media_keys": ["3_1398346745306877952"]}, "conversation_id": "1398346750058958848"}, {"source": "Twitter for iPhone", "id": "1397994361175031811", "text": "Meine Erwartung an die russische Regierung ist, diese Entscheidung zur\u00fcckzunehmen. Einen lebendigen Austausch unserer Gesellschaften kann es nur geben, wenn beide Seiten Widerspruch zulassen.", "created_at": "2021-05-27T19:13:23.000Z", "possibly_sensitive": false, "referenced_tweets": [{"type": "replied_to", "id": "1397994359937712129"}], "public_metrics": {"retweet_count": 3, "reply_count": 0, "like_count": 8, "quote_count": 1}, "lang": "de", "reply_settings": "everyone", "author_id": "159217491", "in_reply_to_user_id": "159217491", "conversation_id": "1397994358545301507"}, {"source": "Twitter for iPhone", "id": "1397994359937712129", "text": "Sie schadet der deutsch-russischen Zusammenarbeit. Die Behauptung, dass die deutschen Organisationen mit ihrer T\u00e4tigkeit irgendeine Gefahr f\u00fcr Russland darstellen, ist absurd. Demokratie lebt von offener Diskussion.", "created_at": "2021-05-27T19:13:23.000Z", "possibly_sensitive": false, "referenced_tweets": [{"type": "replied_to", "id": "1397994358545301507"}], "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 5, "quote_count": 0}, "lang": "de", "reply_settings": "everyone", "author_id": "159217491", "in_reply_to_user_id": "159217491", "conversation_id": "1397994358545301507"}, {"source": "Twitter for iPhone", "id": "1397994358545301507", "text": "Die Entscheidung der russischen Generalstaatsanwaltschaft, die 3 deutschen Organisationen Forum Russischsprachiger Europ\u00e4er e.V., das Zentrum f.d. Liberale Moderne GmbH und der Verein Deutsch-Russischer Austausch e.V.  als \"unerw\u00fcnschte Organisationen\" einzustufen ist falsch.", "created_at": "2021-05-27T19:13:23.000Z", "possibly_sensitive": false, "public_metrics": {"retweet_count": 3, "reply_count": 1, "like_count": 12, "quote_count": 0}, "lang": "de", "reply_settings": "everyone", "author_id": "159217491", "conversation_id": "1397994358545301507"}, {"source": "Twitter for iPhone", "id": "1395302691920826373", "text": "Fr\u00fchst\u00fcck mit der Pr\u00e4sidentin der Republik Moldau Maia Sandu. Gemeinsam mit meinem Kollegen und Vorsitzenden des Deutsch-Moldauischen Forums Fritz Felgentreu hatten wir ein wirklich gutes Gespr\u00e4ch \u00fcber die Situation in der Republik Moldau und die Herausforderungen der Zukunft! https://t.co/xD1CFNGigQ", "created_at": "2021-05-20T08:57:39.000Z", "possibly_sensitive": true, "public_metrics": {"retweet_count": 2, "reply_count": 0, "like_count": 2, "quote_count": 1}, "lang": "de", "entities": {"urls": [{"start": 278, "end": 301, "url"