tion_id": "1342044565725990912"}, {"source": "Twitter for iPhone", "id": "1341758399030173697", "text": "Ich rufe dringend dazu auf, diese Entw\u00fcrfe im weiteren Verfahren noch einmal zu \u00fcberpr\u00fcfen und \u00a0zur\u00fcckzunehmen. Wenn wir Br\u00fccken zwischen unseren L\u00e4ndern aufbauen und bewahren wollen, m\u00fcssen auch unsere Zivilgesellschaften zusammenarbeiten k\u00f6nnen, ohne Nachteile zu bef\u00fcrchten.", "created_at": "2020-12-23T14:51:45.000Z", "possibly_sensitive": false, "referenced_tweets": [{"type": "replied_to", "id": "1341758397855784961"}], "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 3, "quote_count": 0}, "lang": "de", "reply_settings": "everyone", "author_id": "159217491", "in_reply_to_user_id": "159217491", "conversation_id": "1341758396232568841"}, {"source": "Twitter for iPhone", "id": "1341758397855784961", "text": "Diese Versch\u00e4rfung schadet unseren zwischengesellschaftlichen Beziehungen, die sich in Jahrzehnten auf so vielen Gebieten entwickelt haben. Wir haben die Entw\u00fcrfe im Petersburger Dialog mit \ud83c\uddf7\ud83c\uddfaund \ud83c\udde9\ud83c\uddea Akteuren der AG Zivilgesellschaft er\u00f6rtert und diese Sorge zum Ausdruck gebracht.", "created_at": "2020-12-23T14:51:45.000Z", "possibly_sensitive": false, "referenced_tweets": [{"type": "replied_to", "id": "1341758396232568841"}], "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 3, "quote_count": 0}, "lang": "de", "reply_settings": "everyone", "author_id": "159217491", "in_reply_to_user_id": "159217491", "conversation_id": "1341758396232568841"}, {"source": "Twitter for iPhone", "id": "1341758396232568841", "text": "Ich bin entt\u00e4uscht, dass die ohnehin fragw\u00fcrdige russische Gesetzgebung, die zivilgesellschaftliche Organisationen zu \"ausl\u00e4ndischen Agenten\" erkl\u00e4rt, nach der Abstimmung in der russischen Staatsduma auf weitere Organisationen und sogar Personen ausgeweitet werden soll.", "created