, "id": "921292938327576577"}]}, "conversation_id": "1314534383538393089"}, {"source": "Twitter for iPad", "id": "1313936290262458368", "text": "RT @dbg_MinskForum: Der neue @dbg_MinskForum Vorstand traf sich mit @Johann_Saathoff (Koord. BuReg f\u00fcr zwischengesell. Zusammenarbeit mit R\u2026", "created_at": "2020-10-07T20:16:38.000Z", "possibly_sensitive": false, "referenced_tweets": [{"type": "retweeted", "id": "1313935624638992385"}], "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 0, "quote_count": 0}, "lang": "de", "reply_settings": "everyone", "author_id": "159217491", "entities": {"mentions": [{"start": 3, "end": 18, "username": "dbg_MinskForum", "id": "84474100"}, {"start": 29, "end": 44, "username": "dbg_MinskForum", "id": "84474100"}, {"start": 68, "end": 84, "username": "Johann_Saathoff", "id": "159217491"}]}, "conversation_id": "1313936290262458368"}, {"source": "Twitter for iPhone", "id": "1313016475477737472", "text": "Dieses Vertrauen kann schwierige politische Kompromisse zwischen Staaten leichter machen. Die Gewalt um Bergkarabach muss sofort enden. F\u00fcr eine langfristige politische L\u00f6sung braucht es (auch) Kontakt, Austausch und Vertrauensbildung zwischen Zivilgesellschaften.", "created_at": "2020-10-05T07:21:37.000Z", "possibly_sensitive": false, "referenced_tweets": [{"type": "replied_to", "id": "1313016473485541376"}], "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 2, "quote_count": 0}, "lang": "de", "reply_settings": "everyone", "author_id": "159217491", "in_reply_to_user_id": "159217491", "conversation_id": "1313016470624964608"}, {"source": "Twitter for iPhone", "id": "1313016473485541376", "text": "Auf lange Sicht kommt es auf die Zivilgesellschaften an. Politische Verhandlungen gelingen besser, wenn Unterst\u00fctzung daf\u00fcr aus den Zivilgesellschaften kommt. Begegnungen und Austausch von Mensch zu Mensch f\u00f6rdern langfristig Vertrauen zwischen Gesellschaften.", "created_at": "2020-10-05T07:21:36.000Z", "possibly_sensitive": false, "referenced_tweets": [{"type": "replied_to", "id": "1313016470624964608"}], "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 3, "quote_count": 0}, "lang": "de", "reply_settings": "everyone", "author_id": "159217491", "in_reply_to_user_id": "159217491", "conversation_id": "1313016470624964608"}, {"source": "Twitter for iPhone", "id": "1313016470624964608", "text": "Im Konflikt um Bergkarabach muss die Gewalt enden. Armenien und Aserbaidschan sind aufgerufen, die Kampfhandlungen umgehend einzustellen. Dann braucht es den Wiedereinstieg in substanzielle Verhandlungen. Die OSZE-Minsk-Gruppe bleibt daf\u00fcr das richtige Format.", "created_at": "2020-10-05T07:21:35.000Z", "possibly_sensitive": false, "public_metrics": {"retweet_count": 1, "reply_count": 12, "like_count": 11, "quote_count": 1}, "lang": "de", "reply_settings": "everyone", "author_id": "159217491", "conversation_id": "1313016470624964608"}], "includes": {"users": [{"profile_image_url": "https://pbs.twimg.com/profile_images/689395930542407680/nX18H5Gl_normal.jpg", "url": "https://t.co/b7iicKXqJq", "location": "Ostfriesland", "id": "159217491", "verified": true, "entities": {"url": {"urls": [{"start": 0, "end": 23, "url": "https://t.co/b7iicKXqJq", "expanded_url": "http://www.johann-saathoff.de", "display_url": "johann-saathoff.de"}]}}, "name": "Johann Saathoff", "created_at": "2010-06-24T19:53:25.000Z", "public_metrics": {"followers_count": 3453, "following_count": 2630, "tweet_count": 1829, "listed_count": 150}, "username": "Johann_Saathoff", "description": "MdB, Parl. Staatssekret\u00e4r bei der Bundesministerin des Innern und f\u00fcr Heimat, Landesgruppensprecher Nds/HB", "protected": false}, {"profile_image_url": "https://pbs.twimg.com/profile_images/1042369791523217408/PHlGxYjo_normal.jpg", "url": "https://t.co/DMwbYrPytA", "location": "Ukraine", "id": "778884712593035265", "verified": true, "entities": {"url": {"urls": [{