Diese Versch\u00e4rfung schadet unseren zwischengesellschaftlichen Beziehungen, die sich in Jahrzehnten auf so vielen Gebieten entwickelt haben. Wir haben die Entw\u00fcrfe im Petersburger Dialog mit \ud83c\uddf7\ud83c\uddfaund \ud83c\udde9\ud83c\uddea Akteuren der AG Zivilgesellschaft er\u00f6rtert und diese Sorge zum Ausdruck gebracht.", "created_at": "2020-12-23T14:51:45.000Z", "possibly_sensitive": false, "referenced_tweets": [{"type": "replied_to", "id": "1341758396232568841"}], "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 3, "quote_count": 0}, "lang": "de", "reply_settings": "everyone", "author_id": "159217491", "in_reply_to_user_id": "159217491", "conversation_id": "1341758396232568841"}, {"source": "Twitter for iPhone", "id": "1341758396232568841", "text": "Ich bin entt\u00e4uscht, dass die ohnehin fragw\u00fcrdige russische Gesetzgebung, die zivilgesellschaftliche Organisationen zu \"ausl\u00e4ndischen Agenten\" erkl\u00e4rt, nach der Abstimmung in der russischen Staatsduma auf weitere Organisationen und sogar Personen ausgeweitet werden soll.", "created_at": "2020-12-23T14:51:44.000Z", "possibly_sensitive": false, "public_metrics": {"retweet_count": 2, "reply_count": 1, "like_count": 9, "quote_count": 0}, "lang": "de", "reply_settings": "everyone", "author_id": "159217491", "conversation_id": "1341758396232568841"}, {"source": "Twitter Media Studio", "id": "1339506476004601860", "text": "Wir haben beim #EEG ordentlich was hingekriegt! So gibt es durch die Gemeindebeteiligung richtig viel Geld f\u00fcr Kommunen. Aber es gibt noch viel zu tun. @Johann_Saathoff: \"Oder wie man in Ostfriesland sagt:...\" (Haben wir leider nicht verstanden, kann jemand aushelfen?) https://t.co/UvnqgU84R9", "created_at": "2020-12-17T09:43:25.000Z", "possibly_sensitive": false, "public_metrics": {"retweet_count": 8, "reply_count": 5, "like_count": 11, "quote_count": 0}, "lang": "de", "entities": {"urls": [{"start": 270, "end": 293, "url": "https://t.co/U