ies": {"mentions": [{"start": 146, "end": 154, "username": "navalny", "id": "82299300"}]}, "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 8, "quote_count": 0}, "created_at": "2020-09-23T14:51:55.000Z", "author_id": "159217491", "id": "1308781142884126721", "lang": "de", "possibly_sensitive": false, "source": "Twitter for iPhone"}, {"entities": {"urls": [{"start": 199, "end": 222, "url": "https://t.co/CjfWj0z7tt", "expanded_url": "https://twitter.com/Johann_Saathoff/status/1308778279114092547/photo/1", "display_url": "pic.twitter.com/CjfWj0z7tt"}], "mentions": [{"start": 62, "end": 75, "username": "RusBotschaft", "id": "596243227"}]}, "text": "Dank an Botschafter Netschajew, f\u00fcr das offene erste Gespr\u00e4ch @RusBotschaft ! Dialog und zwischengesellschaftliche Zusammenarbeit bleiben auch in schwierigen Zeiten und zu kritischen Themen wichtig! https://t.co/CjfWj0z7tt", "conversation_id": "1308778279114092547", "reply_settings": "everyone", "public_metrics": {"retweet_count": 2, "reply_count": 0, "like_count": 5, "quote_count": 2}, "created_at": "2020-09-23T14:40:32.000Z", "attachments": {"media_keys": ["3_1308778271828578305"]}, "author_id": "159217491", "id": "1308778279114092547", "lang": "de", "possibly_sensitive": true, "source": "Twitter for iPhone"}, {"entities": {"urls": [{"start": 201, "end": 224, "url": "https://t.co/HgGABV0Tc7", "expanded_url": "https://twitter.com/Johann_Saathoff/status/1308476686795771905/photo/1", "display_url": "pic.twitter.com/HgGABV0Tc7"}]}, "text": "Freundliches Kennenlernen mit dem Botschafter der Republik Belarus in Deutschland, Herrn Denis Sidorenko. Die zwischengesellschaftlichen Beziehungen sind gerade jetzt nicht aus den Augen zu verlieren! https://t.co/HgGABV0Tc7", "conversation_id": "1308476686795771905", "reply_settings": "everyone", "public_metrics": {"retweet_count": 0, "reply_count": 3, "like_count": 4, "quote_count": 1}, "created_at": "2020-09-22T18:42:07.000Z", "attachments": {"media_keys": ["3_1308476677526351873"]}, "author_id": "159217491", "id": "1308476686795771905", "lang": "de", "possibly_sensitive": true, "source": "Twitter for iPhone"}, {"entities": {"urls": [{"start": 221, "end": 244, "url": "https://t.co/fa9LYuatxy", "expanded_url": "https://twitter.com/Johann_Saathoff/status/1308474726722002944/photo/1", "display_url": "pic.twitter.com/fa9LYuatxy"}]}, "text": "Gutes erstes Gespr\u00e4ch mit dem Botschafter Kasachstans in Deutschland, Herrn Dauren Karipov. Wir m\u00f6chten unsere zwischengesellschaftlichen Beziehungen noch weiter entwickeln, ich freue mich auf die weitere Zusammenarbeit! https://t.co/fa9LYuatxy", "conversation_id": "1308474726722002944", "reply_settings": "everyone", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 3, "quote_count": 0}, "created_at": "2020-09-22T18:34:19.000Z", "attachments": {"media_keys": ["3_1308474719142903808"]}, "author_id": "159217491", "id": "1308474726722002944", "lang": "de", "possibly_sensitive": true, "source": "Twitter for iPhone"}, {"entities": {"urls": [{"start": 228, "end": 251, "url": "https://t.co/a8N097os7w", "expanded_url": "https://twitter.com/Johann_Saathoff/status/1308473264927367168/photo/1", "display_url": "pic.twitter.com/a8N097os7w"}]}, "text": "Guter erster Austausch mit dem Botschafter Armeniens in Deutschland, Herrn Ashot Smbatyan. Ich freue mich darauf, die Beziehungen zwischen unseren Zivilgesellschaften weiter zu st\u00e4rken und zu vertiefen. Auf gute Zusammenarbeit! https://t.co/a8N097os7w", "conversation_id": "1308473264927367168", "reply_settings": "everyone", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 8, "quote_count": 0}, "created_at": "2020-09-22T18:28:31.000Z", "attachments": {"media_keys": ["3_1308473257557979137"]}, "author_id": "159217491", "id": "1308473264927367168", "lang": "de", "possibly_sensitive": true, "source": "Twitter for iPhone"}, {"entities": {"urls": [{"start": 192, "end": 215, "url": "https://t.co/vl8