 208, "end": 217, "tag": "Russland"}], "mentions": [{"start": 34, "end": 50, "username": "Johann_Saathoff", "id": "159217491"}, {"start": 218, "end": 234, "username": "AuswaertigesAmt", "id": "273468342"}, {"start": 235, "end": 245, "username": "DUF_Forum", "id": "732348877123268609"}, {"start": 246, "end": 261, "username": "dbg_MinskForum", "id": "84474100"}, {"start": 262, "end": 278, "username": "GERonOstpolitik", "id": "950367584721035264"}]}, "text": "Sehr gutes Gespr\u00e4ch in Berlin mit @Johann_Saathoff Koordinator der BuReg. f\u00fcr zwischengesellschaftliche Zusammenarbeit mit Russland, Zentralasien und den L\u00e4ndern der \u00d6stlichen Partnerschaft #Belarus #Ukraine #Russland @AuswaertigesAmt @DUF_Forum @dbg_MinskForum @GERonOstpolitik https://t.co/V380ENMIue", "conversation_id": "1304028204211068929", "reply_settings": "everyone", "public_metrics": {"retweet_count": 3, "reply_count": 0, "like_count": 10, "quote_count": 0}, "created_at": "2020-09-10T12:05:26.000Z", "attachments": {"media_keys": ["3_1304028195159764992"]}, "author_id": "2993002493", "id": "1304028204211068929", "lang": "de", "possibly_sensitive": false, "source": "Twitter for iPhone"}, {"entities": {"urls": [{"start": 154, "end": 177, "url": "https://t.co/Eekop0HNIj", "expanded_url": "https://twitter.com/GermanyinTJ/status/1303597027482374153/photo/1", "display_url": "pic.twitter.com/Eekop0HNIj"}], "hashtags": [{"start": 22, "end": 36, "tag": "Tadschikistan"}, {"start": 47, "end": 58, "tag": "Tadschiken"}, {"start": 113, "end": 130, "tag": "Nationalfeiertag"}]}, "text": "\ud83c\udde9\ud83c\uddeaUnserem Gastland \ud83c\uddf9\ud83c\uddef #Tadschikistan und allen #Tadschiken \u00fcberall auf der Welt w\u00fcnschen wir einen wunderbaren \ud83c\udf87 #Nationalfeiertag und gute Gesundheit!!! https://t.co/Eekop0HNIj", "conversation_id": "1303597027482374153", "reply_settings": "everyone", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 3, "quote_count": 1}, "created_at": "2020-09-09T07:32:05.000Z", "attachments": {"media_keys": ["3_1303597006498258944"]}, "author_id": "1186234413278994432", "id": "1303597027482374153", "lang": "de", "possibly_sensitive": false, "source": "Twitter for Android"}, {"entities": {"urls": [{"start": 220, "end": 243, "url": "https://t.co/WgMgW13jlm", "expanded_url": "https://www.nwzonline.de/plus-politik/russlandbeauftragter-johann-saathoff-spd-aus-pewsum-zum-fall-nawalny-kampfstoff-nowitschok-wirft-fragen-auf_a_50,9,3301925413.html", "display_url": "nwzonline.de/plus-politik/r\u2026"}], "hashtags": [{"start": 9, "end": 29, "tag": "Russlandbeauftragte"}, {"start": 112, "end": 120, "tag": "Nawalny"}], "mentions": [{"start": 79, "end": 95, "username": "Johann_Saathoff", "id": "159217491"}]}, "text": "Der neue #Russlandbeauftragte, der ostfriesische SPD-Politiker Johann Saathoff @Johann_Saathoff , sieht im Fall #Nawalny gro\u00dfen Aufkl\u00e4rungsbedarf. Das sollte auch im Interesse des Kreml liegen, sagt er im NWZ-Interview.\nhttps://t.co/WgMgW13jlm", "conversation_id": "1301580190473220096", "reply_settings": "everyone", "public_metrics": {"retweet_count": 2, "reply_count": 1, "like_count": 4, "quote_count": 0}, "created_at": "2020-09-03T17:57:54.000Z", "author_id": "36744887", "id": "1301580190473220096", "lang": "de", "possibly_sensitive": false, "source": "TweetDeck"}, {"text": "@OstAusschuss @Johann_Saathoff Gratulation Herr Saathoff zum neuen Amt. Was sagen Sie denn zu den Forderungen ihre Parteifreundes @n_roettgen den Pau von #NordStream2 zu stoppen ?", "conversation_id": "1301483112141066242", "entities": {"hashtags": [{"start": 154, "end": 166, "tag": "NordStream2"}], "mentions": [{"start": 0, "end": 13, "username": "OstAusschuss", "id": "2650612676"}, {"start": 14, "end": 30, "username": "Johann_Saathoff", "id": "159217491"}, {"start": 130, "end": 141, "username": "n_roettgen", "id": "1040160799208161280"}]}, "reply_settings": "everyone", "referenced_tweets": [{"type": "replied_to", "id": "1301483112141066242"}], "in_reply_to_user_id": "2650612676", "public_metrics": {"retweet_count": 0, "reply_count": 4, "like_count": 0, "quote_count": 0}, "created_at": "2020-09-03T11:35:01.000Z", "author_id": "841207826148151296", "id": "1301483837629890560", "lang": "de", "possibly_sensitive": false, "source": "Twitter Web App"}, {"entities": {"urls": [{"start": 0, "end": 23, "url": "https://t.co/WEqGe2Og91", "expanded_url": "https://twitter.com/germanyinuz/status/1300450931876732928/photo/1", "display_url": "pic.twitter.com/WEqGe2Og91"}]}, "text": "https://t.co/WEqGe2Og91", "conversation_id": "1300450931876732928", "reply_settings": "everyone", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 2, "quote_count": 1}, "created_at": "2020-08-31T15:10:38.000Z", "attachments": {"media_keys": ["3_1300450907600171008"]}, "author_id": "1278177814215299072", "id": "1300450931876732928", "lang": "und", "possibly_sensitive": false, "source": "Twitter for iPhone"}, {"text": "Herzlichen Gl\u00fcckwunsch nach Kirgisistan zum heutigen Nationalfeiertag! 29 Jahre Unabh\u00e4ngigkeit des Landes. In schwierigen Corona-Zeiten unterst\u00fctzt Deutschland Kirgisistan \u2013 u.a. schicken wir bis zu 50 Beatmungsger\u00e4te und Zubeh\u00f6r in mehrere kirgisische Krankenh\u00e4user.", "conversation_id": "1300447693131730945", "reply_settings": "everyone", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 6, "quote_count": 0}, "created_at": "2020-08-31T14:57:45.000Z", "author_id": "159217491", "id": "1300447693131730945", "lang": "de", "possibly_sensitive": false, "source": "Twitter for iPhone", "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}]}, {"text": "Men Germaniya federal tashqi ishlar vazirligining O'zbekiston bo'yicha koordinatori etib tayinlanganimdan juda mamnunman. Uchrashuvlar va suhbatlardan umidvorman - hatto qiyin mavzular borasida bo'lsa ham.", "conversation_id": "1299395360444514304", "reply_settings": "everyone", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 1, "quote_count": 0}, "created_at": "2020-08-28T17:16:10.000Z", "author_id": "159217491", "id": "1299395360444514304", "lang": "tr", "possibly_sensitive": false, "source": "Twitter for iPad"}, {"text": "Men \u00f6z\u00fcmi\u0148 T\u00fcrkmenistan \u00fc\u00e7in federal da\u015fary i\u015fleri ministrligini\u0148 koordinatory bolup bellenmegime \u00f6r\u00e4n \u015fat. Men t\u00e4ze du\u015fu\u015fyklara we s\u00f6hbetde\u015fliklere, \u015fe\u00fdle hem \u00e7yl\u015fyrymly temalar barada bolsa-da, gara\u015f\u00fdaryn.", "conversation_id": "1299395105141465090", "reply_settings": "everyone", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 2, "quote_count": 0}, "created_at": "2020-08-28T17:15:09.000Z", "author_id": "159217491", "id": "1299395105141465090", "lang": "tr", "possibly_sensitive": false, "source": "Twitter for iPad"}, {"text": "\u041c\u0430\u043d \u0431\u0430 \u0432\u0430\u0437\u0438\u0444\u0430\u0438 \u043d\u0430\u0432 \u0431\u0430 \u04b3\u0430\u0439\u0441\u0438 \u04b3\u0430\u043c\u043e\u04b3\u0430\u043d\u0433\u0441\u043e\u0437\u0438 \u0422\u043e\u04b7\u0438\u043a\u0438\u0441\u0442\u043e\u043d \u0434\u0430\u0440 \u0412\u0430\u0437\u043e\u0440\u0430\u0442\u0438 \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u0438\u0438 \u043a\u043e\u0440\u04b3\u043e\u0438 \u0445\u043e\u0440\u0438\u04b7\u0438\u0438 \u041e\u043b\u043c\u043e\u043d \u0442\u0430\u044a\u0438\u043d \u0448\u0443\u0434\u0430\u043d\u0430\u043c \u0445\u0435\u043b\u0435 \u0448\u043e\u0434\u0430\u043c. \u0411\u0435\u0441\u0430\u0431\u0440\u043e\u043d\u0430 \u0431\u0430\u0440\u043e\u0438 \u0441\u04ef\u04b3\u0431\u0430\u0442 \u0432\u0430 \u0432\u043e\u0445\u04ef\u0440\u0438\u04b3\u043e \u0438\u043d\u0442\u0438\u0437\u043e\u0440\u0430\u043c -  \u04b3\u0430\u0442\u0442\u043e \u0430\u0433\u0430\u