it unserem Ministerpr\u00e4sidenten Stephan Weil durch die Otto-Ausstellung in der Kunsthalle Emden. Irgend wie haben Ottos Werke auch mit meinem Leben zu tun... @ Kunsthalle Emden https://t.co/wUOmUzbnUy", "conversation_id": "1147192387397177352", "reply_settings": "everyone", "lang": "de"}, {"geo": {"place_id": "e93c61ac16e88279", "coordinates": {"type": "Point", "coordinates": [7.45889, 53.4042]}}, "id": "1147188098180296707", "author_id": "159217491", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "created_at": "2019-07-05T16:58:50.000Z", "possibly_sensitive": false, "source": "Instagram", "entities": {"urls": [{"start": 186, "end": 209, "url": "https://t.co/nFeiC958E4", "expanded_url": "https://www.instagram.com/p/Bzium6MFsF3BtEo2D591M-EMGwAlHa9Jor_ez00/?igshid=14ccom1q59d93", "display_url": "instagram.com/p/Bzium6MFsF3B\u2026"}]}, "text": "Die Ihlower Klostertst\u00e4tte hat heute ihren 10. Geburtstag in Anwesenheit unseres Ministerpr\u00e4sidenten Stephan Weil gefeiert. Danke f\u00fcr die Einladung, f\u00fcr das herausragende ehrenamtliche\u2026 https://t.co/nFeiC958E4", "conversation_id": "1147188098180296707", "reply_settings": "everyone", "lang": "de"}, {"geo": {"place_id": "772095b73ce266f1", "coordinates": {"type": "Point", "coordinates": [7.19477, 53.60505]}}, "id": "1147185593689886721", "author_id": "159217491", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "created_at": "2019-07-05T16:48:53.000Z", "possibly_sensitive": false, "source": "Instagram", "entities": {"urls": [{"start": 188, "end": 211, "url": "https://t.co/CsmTjEpOfU", "expanded_url": "https://www.instagram.com/p/BziteLIFjv3Gv-rLB1NXLt3FF0VoFkYIN4_fdw0/?igshid=gpvsgf2cgiib", "display_url": "instagram.com/p/BziteLIFjv3G\u2026"}]}, "text": "Gestern waren mein Landtagskollege Matthias Arends und ich zu Besuch bei der DLRG Ortsgruppe Norden e.V.. Diesmal nicht mit Besprechung am Tisch, sondern mit Pres