ook.com/10000004876665\u2026"}]}, "text": "Gestern hatte ich Besuch von meinem Berliner Kollegen Klaus Mindrup, MdB. Wir waren gemeinsam mit der SPD-Fraktionsvorsitzenden Maria Winter beim \u00dcltje-Gel\u00e4nde, um uns \u00fcber das St\u00e4dtebauprojekt zu informieren.... https://t.co/ocr3BDosE5", "source": "Facebook", "author_id": "159217491"}, {"created_at": "2018-08-21T15:55:26.000Z", "lang": "de", "conversation_id": "1031869975072583680", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "in_reply_to_user_id": "829419032122163205", "possibly_sensitive": false, "id": "1031932800423931905", "referenced_tweets": [{"type": "replied_to", "id": "1031869975072583680"}], "reply_settings": "everyone", "text": "@WachterBDI @Der_BDI @welt Dabei!", "source": "Twitter for iPad", "entities": {"mentions": [{"start": 12, "end": 20, "username": "Der_BDI", "id": "57043880"}, {"start": 21, "end": 26, "username": "welt", "id": "8720562"}]}, "author_id": "159217491"}, {"attachments": {"media_keys": ["3_1031270251974066179"]}, "entities": {"hashtags": [{"start": 257, "end": 274, "tag": "unfuulb\u00fcstoknoch"}], "urls": [{"start": 275, "end": 298, "url": "https://t.co/KOrt3uVTiU", "expanded_url": "https://twitter.com/Johann_Saathoff/status/1031270265576206337/photo/1", "display_url": "pic.twitter.com/KOrt3uVTiU"}]}, "created_at": "2018-08-19T20:02:46.000Z", "lang": "de", "conversation_id": "1031270265576206337", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 5, "quote_count": 0}, "possibly_sensitive": false, "id": "1031270265576206337", "reply_settings": "everyone", "text": "Wir haben unseren Titel in der Wattarena Upleward nicht verteidigen k\u00f6nnen, aber es hat wieder einen Riesenspa\u00df gemacht!\nHerzlichen Gl\u00fcckwunsch an Team \u201eWaterh\u00f6rn\u201c zum W\u00e4ltmeistertitel und herzlichen Dank an die Organisatoren f\u00fcr die perfekte Organisation! #unfuulb\u00fcstoknoch https://t.co/KOrt3uVTiU", "source": "Twitter for iPhone", "author_id": "159217491"}, {"created_at": "2018-08-16T10:36:29.000Z", "lang": "de", "conversation_id": "1030040592238239745", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 2, "quote_count": 0}, "possibly_sensitive": false, "id": "1030040592238239745", "reply_settings": "everyone", "entities": {"urls": [{"start": 44, "end": 67, "url": "https://t.co/5wBLQe8rwO", "expanded_url": "https://www.facebook.com/story.php?story_fbid=2090606360950969&id=100000048766655", "display_url": "facebook.com/story.php?stor\u2026"}]}, "text": "Der Kampf um die Arbeitspl\u00e4tze geht weiter! https://t.co/5wBLQe8rwO", "source": "Facebook", "author_id": "159217491"}, {"entities": {"hashtags": [{"start": 140, "end": 154, "tag": "allv\u00f6lstolaat"}, {"start": 155, "end": 166, "tag": "netzejetzt"}, {"start": 167, "end": 181, "tag": "peteraltmaier"}, {"start": 193, "end": 206, "tag": "energiewende"}]}, "created_at": "2018-08-14T15:14:01.000Z", "lang": "de", "conversation_id": "1029385663425245184", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 5, "quote_count": 0}, "possibly_sensitive": false, "id": "1029385663425245184", "reply_settings": "everyone", "text": "Aktionsplan Stromnetz gut, aber zu sp\u00e4t. Hoffe, dass wir schnell beschlie\u00dfen k\u00f6nnen, denn die CDU/CSU blockiert noch immer 100-Tage-Gesetz.\n#allv\u00f6lstolaat #netzejetzt #peteraltmaier @bmwi_bund #energiewende", "source": "Twitter for iPad", "author_id": "159217491"}, {"created_at": "2018-08-13T19:08:37.000Z", "lang": "de", "conversation_id": "1029082311705460736", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 5, "quote_count": 0}, "possibly_sensitive": false, "id": "1029082311705460736", "reply_settings": "everyone", "entities": {"urls": [{"start": 208, "end": 231, "url": "https://t.co/RKDjpQVCz6", "expanded_url": "https://www.facebook.com/100000048766655/posts/2085983218079950/", "display_url": "facebook.com/1